import os

os.chdir("C:\\Users\\Estrel\\Downloads")

encrypted = bytes.fromhex(
    ""
)

head = encrypted[:16]
png = b"\x89\x50\x4E\x47\x0D\x0A\x1A\x0A\x00\x00\x00\x0D\x49\x48\x44\x52"

keystream = bytes(a ^ b for a, b in zip(head, png))
decrypted = b""

for i in range(0, len(encrypted), 16):
    decrypted += bytes(a ^ b for a, b in zip(encrypted[i : i + 16], keystream))

with open("decrypted.png", "wb") as f:
    f.write(decrypted)
